import './App.css';

function Header() {
  return(
    <div class="navbar">
      <div class="flex-1">
        <h2>My Poca Wishlist Maker</h2>
      </div>
      <div>
        
      </div>
      <ul class="menu menu-horizontal"> 
        <li>Items</li>
        <li>Wishlists</li>
      </ul>

    </div>
  ) 
}

function App() {
  return(
    <div>
      <Header />
    </div>
  )
 
}

export default App;
